import React, { Component } from "react";
import QuoteContainer from "./quote-container";

class Page extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.handleData = this.handleData.bind(this);
  }

  styles = {
    background: "",
    width: "100vw",
    height: "100vh"
  };

  handleData(rgb) {
    // this.styles.background = `rgb(${rgb})`;
  }
  render() {
    return (
      <div style={this.styles}>
        <h1 style={{ color: "black" }}>{this.styles.background}</h1>
        <QuoteContainer color={this.handleData} />
      </div>
    );
  }
}

export default Page;
